import React from 'react';
function Login() {
    return (
        <div>
            <h1>Login</h1>
            <h3>Login</h3>
            <form>
                <input type='text' placeholder='login'/>
                <input type='password' placeholder='password'/>
            </form>
            <h3>Register</h3>
            <form>
                <input type='text' placeholder='login'/>
                <input type='password' placeholder='password'/>
            </form>
        </div>
    );
}

export default Login;
